import Image from "next/image";
import style from "./Jumbotron.module.css";

export const Jumbotron = () => {
  return (
    <div className={style.jumbotron}>
      <div className={style.gradient}></div>
      <Image
        className={style.nextimage}
        alt="cart-personal"
        src="/cart-personal.png"
        layout="fill"
      />
    </div>
  );
};
